import './index.scss';
import Sidebar from '../Sidebar';
import React, { useEffect } from 'react';
import { Outlet } from 'react-router-dom';
import LogoE from '../../assets/images/e.png';


const Layout = () => {

    useEffect(() => {
        document.title = 'Erin Argo | '
    }); 

    return (
        <div className='App'>
            <Sidebar />
            <div className='page'>
                <h1>Hi.</h1>
                <h3>My name is Erin,</h3>
                <h3>I'm your next <a><ch>Full Stack Developer</ch></a></h3>
                
                <button class='contact-me'>Contact Me</button>

                <span className='long white'></span>
                <span className='short white'></span>
                <span className='short white'></span>
                <span className='short white'></span>
                <span className='long orange'></span>
                <span className='long orange'></span>

                <span className='big-avatar'></span>
            </div>
        </div>
    )
}

export default Layout;
